import './App.css';
import {Button} from '@mui/material';

function App() {
  return (
    <div className="App">
      <h1>wecedMerced</h1>

      <div className="form">
        <label>Events: </label>
        <input type="text" name="Event" />
        <label>Summary: </label>
        <input type="text" name="Summary" />

        <Button className="Button">
          Submit
        </Button>

      </div>

      <div calendar="Event">
        <iframe src="https://calendar.google.com/calendar/embed?src=22400e73d8531058f9bdb708afcff419523de0e7c1fbac802af8bbe6ec14d09a%40group.calendar.google.com&ctz=America%2FLos_Angeles" style="border: 0" width="800" height="600" frameborder="0" scrolling="no"></iframe>
      </div>
    </div>
  );
}

export default App;
